INSERT INTO `виды_тстк` VALUES (1,'интроскоп','Сканирование объектов, выявление скрытых тайников или вложений посредством классификации провозимых грузов по группам, классам, типам.',20),(2,'инспекционно-досмотровой комплекс','Комплекс специальной электронной аппаратуры, предназначенный для таможенного контроля крупногабаритных объектов.',30),(3,'металлоискатель','Обнаруживает наличие предметов из металла (цветных, черных).',10),(4,'эндоскоп','Используется для досмотра объектов на предмет контрабанды в труднодоступных местах в глубине автомобиля.',10),(5,'детектор наркотических веществ','Выявление наличия мельчайших частиц наркотических веществ в багаже, одежде, корреспонденции, машинах и других предметах.',30),(6,'детектор взрывчатых веществ','Выявление наличия мельчайших частиц взрывчатых веществ в багаже, одежде, корреспонденции, машинах и других предметах.',30),(7,'программно-аппаратный комплекс для контроля подлинности документов, денежных знаков и защищенных бумаг','Предназначен для криминалистического исследования документов, денежных знаков и защищенных бумаг на предмет выявления фальсификаций.',10),(8,'прибор для идентификации лесо- и пиломатериалов лиственных и хвойных пород древесины','Прибор для идентификации лесо- и пиломатериалов лиственных и хвойных пород древесины, перевозимой любым видом транспорта.',15),(9,'фотокамера','Фиксация материалов проведения досмотра груза.',8),(10,'весы автомобильные','Предназначены для измерения массы груза, перевозимого автомобильным транспортом, путём измерения массы гружёного и порожнего транспорта.',20);
